import React from 'react';
import ProductCard from './ProductCard';
import './ProductList.css';

const games = [
  {
    id: 1,
    name: 'Elden Ring',
    image: 'https://image.api.playstation.com/vulcan/ap/rnd/202107/2719/2vnx4acmdU2nvhlL8z8D1EVf.png',
    price: 59.99,
    rating: 5
  },
  {
    id: 2,
    name: 'Final Fantasy 16',
    image: 'https://image.api.playstation.com/vulcan/ap/rnd/202206/1617/hM4oNljZX3P7EfwOb3sRvRMi.png',
    price: 69.99,
    rating: 4
  },
  {
    id: 3,
    name: 'Pokemon Scarlet',
    image: 'https://assets.nintendo.com/image/upload/c_fill,q_auto:eco,w_600/ncom/en_US/games/switch/p/pokemon-scarlet-switch/hero',
    price: 49.99,
    rating: 4
  },
  {
    id: 4,
    name: 'Demon Souls',
    image: 'https://image.api.playstation.com/vulcan/img/rnd/202010/1523/PnWuxLlqTXsUt2A6IhycTz0Z.png',
    price: 59.99,
    rating: 5
  },
  {
    id: 5,
    name: 'GTA V',
    image: 'https://upload.wikimedia.org/wikipedia/en/a/a5/Grand_Theft_Auto_V.png',
    price: 29.99,
    rating: 4
  },
  {
    id: 6,
    name: 'FC 24',
    image: 'https://media.contentapi.ea.com/content/dam/ea/fifa/fifa-23/launch/common/fifa-23-cover-16x9.png',
    price: 59.99,
    rating: 3
  },
  {
    id: 7,
    name: 'Madden 25',
    image: 'https://upload.wikimedia.org/wikipedia/en/1/1d/Madden_NFL_25_cover.jpg',
    price: 59.99,
    rating: 3
  },
  {
    id: 8,
    name: 'Civilization 6',
    image: 'https://cdn.akamai.steamstatic.com/steam/apps/289070/capsule_616x353.jpg?t=1602812795',
    price: 39.99,
    rating: 4
  }
];

function ProductList() {
  return (
    <div className="product-list">
      {games.map(game => (
        <ProductCard
          key={game.id}
          name={game.name}
          image={game.image}
          price={game.price}
          rating={game.rating}
        />
      ))}
    </div>
  );
}

export default ProductList;
